export default{
    // 定义同步方法
    setCataList(state,v){
        state.cataList = v;
    },
    setGuideList(state,v){
        state.guideList = v;
    },
    setReportList(state,v){
        state.reportList = v;
    },
    setSiteList(state,v){
        state.siteList = v;
    },
    setQuaList(state,v){
        state.quaList = v;
    },
    setChartList(state,v){
        state.chartList = v;
    },
    
}
